import { createApp } from "vue";
import App from "./App.vue";
import LoginForm from "./LoginForm.vue"; // Importa tu componente LoginForm
import { createRouter, createWebHistory } from "vue-router";

const router = createRouter({
  history: createWebHistory(),
  routes: [
    { path: "/", component: App }, // Ruta para el componente principal
    { path: "/login", component: LoginForm }, // Ruta para el componente LoginForm
  ],
});

createApp(App).use(router).mount("#app");
